base64Str = ""

def resize(img):
    # if img == "":
    #     img = Image.open(io.BytesIO(requests.get(img).content))

    before_x, before_y = img.size[0], img.size[1]
    x = int(round(float(400 / float(before_y) * float(before_x))))
    y = 400
    resize_img = img
    resize_img.thumbnail((x, y), Image.ANTIALIAS)
    return resize_img

img_binary = base64.b64decode(base64Str)
image = Image.open(io.BytesIO(img_binary))
image = resize(image)
print(type(image))
image.show()
